INSERT INTO `products` VALUES (2,25000,100,'Một loại trà đá hương vị tươi mát, sữa được trộn với nền trà, trái cây và siro hương vị.',_binary '',_binary '',_binary '\0','Trà sữa',0,2),(3,45000,65,'Một thức uống thơm ngon hấp dẫn có tính giải nhiệt cao, cùng hương vị ngọt ngào từ trái đào chín mọng hoà cùng vị ngọt béo từ sữa hay vị chua ngọt thanh mát từ trái cây sẽ làm những phút giây uống trà mượt mà và trọn vẹn nhất.',_binary '',_binary '',_binary '\0','Trà đào',0,2),(4,10000,400,'Một loại đồ uống có ga được sản xuất bởi Công ty Coca-Cola. Là một thức uống giải khát rất phổ biến trên toàn thế giới.',_binary '',_binary '',_binary '\0','Coca Cola',0,2),(5,10000,450,'Một loại đồ uống có ga được sản xuất bởi Công ty PepsiCo. Là một thức uống giải khát rất phổ biến trên toàn thế giới.',_binary '',_binary '',_binary '\0','Pepsi',0,2),(6,24000,90,'Là một trong những loại thức uống quen thuộc của người dân Việt, theo đó một ly cà phê đen đúng nghĩa thì sẽ là một ly cà phê nguyên chất không cho thêm sữa hoặc kem, từ đó mà người thưởng thức có thể hưởng trọn được những hương vị của cà phê mang lại.',_binary '',_binary '',_binary '\0','Cà phê đen',0,2),(7,30000,70,'Là một loại đồ uống được làm từ cà phê có pha sữa nhưng phần sữa sẽ nhiều hơn so với phần cà phê. Từ “bạc xỉu” xuất phát từ tiếng Quảng Đông và được người Hoa dùng phổ biến trong khu vực buôn bán ở Sài Gòn - Chợ lớn lúc bấy giờ.',_binary '',_binary '',_binary '\0','Bạc xỉu',0,2),(8,15000,56,'Là sự kết hợp hoàn hảo giữa vị trà ngon và chanh tươi. Mang đến một món uống giải khát và đem lại cảm giác sảng khoái khi thưởng thức. Trà chanh góp phần tăng thêm tinh thần tỉnh táo, thư giãn và sáng tạo khiến cho khách hàng yêu thích.',_binary '',_binary '',_binary '\0','Trà chanh',0,2),(9,99000,100,'Là một món ăn truyền thống làm từ gạo tấm, dùng chung với nhiều món ăn kèm như trứng ốp la, sườn heo nướng, chả trứng, da heo thái sợi... Thêm vào đó sẽ có hành lá thái nhỏ, nước mắm tỏi ớt, cà chua, dưa chuột và rau củ ngâm.',_binary '',_binary '',_binary '\0','Cơm tấm',0,1),(10,20000,160,'Một loại trà ép ra từ trái tắc. Là một loại đồ uống giải khát phổ biến.',_binary '',_binary '',_binary '\0','Trà tắc',0,2),(11,20000,154,'Là món cơm nấu đã được chế biến trong chảo hoặc chảo rán và thường được trộn với các thành phần khác như trứng, rau, hải sản hoặc thịt. Nó thường được ăn riêng lẻ hoặc như một món ăn kèm cho món ăn khác.',_binary '',_binary '',_binary '\0','Cơm rang',0,1),(12,15000,137,'Là món ăn phổ biến, được mang đi làm, đi học hoặc đi dã ngoại để làm một món trong bữa trưa được đóng gói với các loại nhân thịt, rau...',_binary '',_binary '',_binary '\0','Bánh mì',0,1),(13,20000,200,'Là một trong những món ăn thông dụng trong ẩm thực đường phố ở châu Á. Món ăn được chế biến từ mì bằng phương pháp xào, cho thêm rau củ, thịt, sốt...',_binary '',_binary '',_binary '\0','Mì xào',0,1),(14,40000,89,'Là món gà được lăn trong bột và chiên giòn ngập dầu. Món ăn có một lớp vỏ ngoài giòn rụm, bên trong thịt vẫn mềm và mọng nước',_binary '',_binary '',_binary '\0','Gà rán',0,1),(15,45000,89,'Là món ăn truyền thống của Việt Nam. Món ăn có thành phần là bánh phở được trần với nước dùng cùng thịt bò hoặc gà thái mỏng',_binary '',_binary '',_binary '\0','Phở',0,1),(16,35000,900,'Là loại bánh được làm thành hình đồng xu, có nhân ở bên trong là phô mai',_binary '',_binary '',_binary '\0','Bánh đồng xu',0,1),(17,35000,567,'Là món ăn được biến tấu từ món phở truyền thống, với bánh phở, thịt bò, rau sống cuốn lại rồi chấm vào nước chấm chua ngọt.',_binary '',_binary '',_binary '\0','Phở cuốn',0,1),(18,55000,132,'Là món ăn nổi tiếng của Hàn Quốc. Món ăn là món cơm được cuộn trong rong biển cùng với nhiều loại nhân như trứng, phô mai, thịt...',_binary '',_binary '',_binary '\0','Gimbap',0,1),(19,15000,123,'La mot loai kem',_binary '',_binary '',_binary '\0','Kem Trang Tien',0,6);
